import React from 'react';
import { Doughnut } from 'react-chartjs-2';
import 'chart.js/auto'; // Required for Chart.js integration
import './GrowthPlan.css';
import Growth from '../GrowthPlan/growth.png';

const GrowthPlan = ({ Notes }) => {
    // Donut chart data
    const communicationData = {
        labels: ['Progress', 'Remaining'],
        datasets: [
            {
                data: [70, 30], // Example data
                backgroundColor: ['#F6A3B6', '#F0F0F0'],
                borderWidth: 0,
            },
        ],
    };

    const leadershipData = {
        labels: ['Progress', 'Remaining'],
        datasets: [
            {
                data: [50, 50], // Example data
                backgroundColor: ['#97DDA8', '#F0F0F0'],
                borderWidth: 0,
            },
        ],
    };

    const negotiationData = {
        labels: ['Progress', 'Remaining'],
        datasets: [
            {
                data: [30, 70], // Example data
                backgroundColor: ['#FDECD8', '#F0F0F0'],
                borderWidth: 0,
            },
        ],
    };

    return (
        <div className="growth-container">
            <div className="growth-text1">
                <h1>Current role</h1>
                <h2>Role:</h2>
                <p>Sales Developments Representative</p>
            </div>
            <div className="growth-text2">
                <h2>Level:</h2>
                <p>Intermediate</p>
            </div>
            <div className="growth-text3">
                <h1>Goals</h1>
                <h2>Short Term:</h2>
                <p>Go from Intermediate to Advance level SDR</p>
            </div>
            <div className="growth-text4">
                <h2>Long Term:</h2>
                <p>Account Executive</p>
            </div>
            <div className="growth-text5">
                <h1>Focus skills</h1>
            </div>

            {/* Communication Card */}
            <div className="growth-box1">
                <h2>Communication</h2>
                <Doughnut data={communicationData} className="donut-chart" />
                <p>Ask for help</p>
                <p>Keep your AE informed of account progress</p>
                <p>Involve product when needed</p>
            </div>

            {/* Leadership Card */}
            <div className="growth-box2">
                <h2>Leadership</h2>
                <Doughnut data={leadershipData} className="donut-chart" />
                <p>Help teammates who struggle</p>
                <p>Take on initiatives outside your role</p>
                <p>Give feedback when you have</p>
            </div>

            {/* Negotiation Card */}
            <div className="growth-box3">
                <h2>Negotiation</h2>
                <Doughnut data={negotiationData} className="donut-chart" />
                <p>Be better at following the playbook</p>
                <p>Involve multiple stakeholders</p>
                <p>Don’t disclose price in first call</p>
            </div>
        </div>
    );
};

export default GrowthPlan;
